function Ayy(e,t){switch("undefined"==typeof t&&(t="query"),t){case"query":return document.querySelector(e)
case"queryall":return document.querySelectorAll(e)
case"id":return document.getElementById(e)
case"class":return document.getElementsByClassName(e)
case"tag":return document.getElementsByTagName(e)
case"name":return document.getElementsByName(e)
default:return document.querySelector(e)}}